script: |
  super -f text -I q3291.spq | sort > q3291.out

inputs:
  - name: q3291.spq
    data: |
      SELECT DISTINCT COUNT ( * ) + + 85 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( + col1 ) * + 91 BETWEEN col0 AND + 53 * + 50;
  - name: tab2

outputs:
  - name: q3291.out
    data: |
      88
